@hytonen79 Tällä kertaa kuvasin vanhan tiilitalon joka on varmasti aikanaan ollut jonkun unelma ja nyt särkynyt unelma. Kuten arvata saattaa niin tuo katto tyyppi kertoo jo paljon että ongelmia on tiedossa jos ei huoltoja tehdä. Paikka oli luultavasti ollut hyvin puiden seassa piilossa, nyt paljastui kun hakkuu työt oli tehty. Ihme kun ei vandaalit olleet ennättäneet paikalle, yksi ikkuna oli rikki ja sekin on voinut mennä jostain muusta kun ilkivallasta. Talo on ilmeisesti ollut pitkään asumaton, vaikutti että oli alkuperäiskuntoinenkin vielä. Ei mitään modernia ja värit oli ajalta kun vielä osattiin ja uskallettiin käyttää sävyjä. Sisä puoli saattaa järkyttää heikoimpia, oli aikamoinen yllätys itselleni kanssa. Luultavasti näitä tämän tyyppisiä taloja on paljonkin tyhjänä.

